import React, { useState } from "react";
import ClothingCategoriesCard from "../components/ClothingCategoriesCard";
import shirtIcon from "../clothe_images/shirticon.webp"
import pantsIcon from "../clothe_images/pantsicon.webp"
import accessIcon from "../clothe_images/"

const ClothingLibraryPage = () => {
    return (
      <>
        <div className="flex flex-wrap justify-evenly m-4">
          <ClothingCategoriesCard
            // onClick={() => openModal("twentytotenModal")}
            image={require("../work_assets/icons/20to10_icon.avif")}
            title="20 to 10"
          />
          <ClothingCategoriesCard
            // onClick={() => openModal("votingiscoolModal")}
            image={require("../work_assets/icons/Lamar_UpClose.webp")}
            title="V00TING 1S C001"
          />
          <ClothingCategoriesCard
            // onClick={() => openModal("ataModal")}
            image={require("../work_assets/icons/Untitled-1.webp")}
            title="Across The Amtrak"
          />
        </div>
      </>
    );
}

export default ClothingLibraryPage
